                        "rules.3": "\u0110\u0103ng b\xe0i vi\u1ebft sai hashtags (than \u1ebf, than \u0111\xf3i \u2026), n\u1ed9i dung (thu\xea tr\u1ea3 qua th\u1ebb \u0111i\u1ec7n tho\u1ea1i, th\u1ebb game, ATM), h\xecnh \u1ea3nh kh\xf4ng li\xean quan \u0111\u1ebfn PlayerDuo ho\u1eb7c c\xf3 li\xean quan t\u1edbi v\u1ea5n \u0111\u1ec1 ch\xednh tr\u1ecb, t\xf4n gi\xe1o, ph\u1ea3n \u0111\u1ed9ng, \u0111\u1ed3i tr\u1ee5y, ph\xe2n bi\u1ec7t v\xf9ng mi\u1ec1n...",
