                        "rules.8": "Kh\xf4ng thu\xea n\u1ee3, kh\xf4ng thu\xea ng\u01b0\u1eddi y\xeau - h\u1eb9n \u1edf ngo\xe0i - l\u1ea7n \u0111\u1ea7u nh\u1eafc nh\u1edf t\u1eeb l\u1ea7n 2 th\xec s\u1ebd block v\u0129nh vi\u1ec5n. (C\u1ea3 nam l\u1eabn n\u1eef).",
